import { Link } from 'react-router-dom';


function SearchResults({ albums }) {
    



  return (
    <div>
      {albums.map((album) =>
        album.strAlbum ? (
          <div key={album.idAlbum}>
            <h3>{album.strAlbum}</h3>
            <p>{album.strArtist}</p>
            <Link to={`/song/${album.idAlbum}`}>Ver detalles</Link>
          </div>
        ) : null
      )}
    </div>
  );
}

export default SearchResults;
